import React from "react"
import {authentication} from "../firebase-config"
import { signInWithPopup, GoogleAuthProvider } from "firebase/auth";
import logo from "../images/quiz.png"
import "../CSS/signin.css"
import { getAuth, signOut } from "firebase/auth"; 

export default function SignIn (){



        const signInWithGoogle =  ()=>{
          const provider = new GoogleAuthProvider()
          signInWithPopup(authentication, provider)
          .then((re) =>{
            console.log(re)
          })
          .catch((err) =>{
            console.log(err)
          })

          const auth = getAuth();
            signOut(authentication).then(() => {
            // Sign-out successful.
            }).catch((error) => {
            // An error happened.
            });
            const user = auth.currentUser;
            if (user !== null) {
              // The user object has basic properties such as display name, email, etc.
              const displayName = user.displayName;
              const email = user.email;
              const photoURL = user.photoURL;
              const emailVerified = user.emailVerified;

              // The user's ID, unique to the Firebase project. Do NOT use
              // this value to authenticate with your backend server, if
              // you have one. Use User.getToken() instead.
              const uid = user.uid;
            }

        }

        return (
          <p id = "quizdisplay">Sign-In
          <body className="Container-signin">

            <div className = "sign-in-cont">
              <p>Welcome {us}</p>
              <div id = "logo">

               <p id = "quiz-name">Ultimate-Quiz</p>
              </div>
              <div>
                <button onClick={signInWithGoogle} id = "bbutton-signin"> </button>
              </div>
              <div>
                <h6 id= "builtby">Built by Armoni Tigner</h6>

              </div>
            </div>
          </body>
        </p>
        );
      }
